{"operationName":"feedContext","variables":{"objectType":"user","objectSlug":""},"query":"query feedContext($objectType: String!, $objectSlug: String!) {
  objectInfo(objectType: $objectType, objectSlug: $objectSlug) {
    ... on Company {
      id
      name
      features {
        slug
        __typename
      }
      __typename
      imageUrl
      canonicalUrl
      path
      tags {
        id
        name
        __typename
      }
    }
    ... on User {
      id
      displayName
      __typename
      imageUrl
      path
      title
      companyName
    }
    ... on Tool {
      id
      name
      __typename
      imageUrl
      canonicalUrl
      following
      category {
        name
        slug
        __typename
      }
      layer {
        name
        slug
        __typename
      }
      function {
        name
        slug
        __typename
      }
    }
    ... on Layer {
      id
      name
      __typename
    }
    ... on Function {
      id
      name
      __typename
    }
    ... on Category {
      id
      name
      __typename
    }
    __typename
  }
}
"}
